def solve(string, k):
    letters = list(string)
    letters = list(set(letters))
    letters.sort()
    string = list(string)
    counter = 0
    for letter in letters:
        while letter in string:
            string.remove(letter)
            counter += 1
            if counter == k:
                return ''.join(string)

    return ''


print(solve('', 3880))

